// import logo from './asset/logo192.png';
import './App.css';
import React from 'react';
import Header from './components/Header';
// import Sider from './components/Sider';
import home from './page/home';

function App() {
  return (
    <>
    <Route exact path="/home">
    <Home />
  </Route>
  <Route exact path="/">
    <Redirect to="/home" />
  </Route>
  </>
  )}

export default App;
